    public static void main(String[] args) {
        String toConstBG = "";
        String toConstSP = "";
        try {
            List<String> allLines = Files.readAllLines(Paths.get("__imagenes/toConstBG.txt"));
            for (String line : allLines) {
                toConstBG += line.trim();
            }
        } catch (IOException e) {
                e.printStackTrace();
        }
        try {
            List<String> allLines = Files.readAllLines(Paths.get("__imagenes/toConstSP.txt"));
            for (String line : allLines) {
                toConstSP += line.trim();
            }
        } catch (IOException e) {
                e.printStackTrace();
        }
        Main.CONSTANT_BG = toConstBG;
        Main.CONSTANT_SP = toConstSP;
        // TODO code application logic here
        MiVentana ventana = new MiVentana(800, 600);
        ventana.setTitle("VideoJuego");
        ventana.setDefaultCloseOperation(ventana.EXIT_ON_CLOSE);
        ventana.setResizable(false);
        ventana.setVisible(true);
        ventana.setFocusable(true);
    }
